  true,\n\t\"url\": null,\n\t\"notes\": \"<p>There were 44,246 individuals enrolled
  in TexKat in 2005. Roughly 13 percent of these enrollees had at least one ED visit
  during the sample period, with one quarter of these individuals having more than
  one visit. Across all enrollees the most common diagnosis was other upper respiratory
  infection, but there were significant differences in diagnosis patterns across ethnic
  groups. The regression analysis suggests little difference in ED utilization across
  genders, but significant contrasts across ethnic and age groups.</p>n\",\n\t\"license_title\":
